import React, { Component } from "react";
import './SearchBox.css';

class SearchBox extends Component {
  constructor() {
    super();
  }

  render() {
    const searcBar = {
      logo: <img src="../images/logo.png" alt="lupa" alt="Imagem de uma lupa na barra de pesquisa." />,
      lupa: <img src="../images/lupa.png" alt="lupa" alt="Imagem de uma lupa na barra de pesquisa." />,
      input: <input className='' type="search" name="search" placeholder="Buscar produtos, marcas e muito mais..." />
    };

    return (
      <>
        <div className='search-box'>
          {searcBar.logo}
          <form action="">
            {searcBar.input}
            {searcBar.lupa}
          </form>
        </div>
      </>
    );
  }
}

export default SearchBox;
